['Acuerdo entre el MIDES y el Ministerio de Educación (MEDUCA) para el fortalecimiento de la oferta de servicios para los beneficiarios de los programas del MIDES y para facilitar el cumplimiento de las corresponsabilidades de los beneficiaries. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Acuerdo entre el MIDES y el Ministerio de Salud (MINSA) para el fortalecimiento de la oferta de servicios para los beneficiarios de los programas del MIDES y para facilitar el cumplimiento de las corresponsabilidades de los beneficiaries. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Ayuda Memoria del Comité Técnico de la CONAIPI que aprueba el Manual Operativo del Programa de Atención Integral a la Infancia “Cuidarte” para áreas comarcales y rurales dispersas. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Circular del MINSA que documente que se esté utilizando la Libreta del Niño para al menos veinte mil (20.000) niños o madres gestantes. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Decreto Ejecutivo que asigna al MIDES la competencia como entidad rectora y supervisora de los CAIPI (antes COIF). PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Estándares de Calidad para los CAIPI (antes COIF). PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Ley que establece el marco legal de los programas de transferencias monetarias y que crea el Registro Único de los Beneficiarios de dichos programas y la plataforma única para el pago de las transferencias.
La Ley establece, entre otros: (i) la facultad del Ministerio de Desarrollo Social (MIDES), como ente rector de la política social, de reglamentar los mecanismos de identificación de la población en pobreza y pobreza extrema, así como los criterios e intervalos para la recertificación de dicha población; (ii) que dichos mecanismos de identificación y recertificación sean aplicados a los programas de transferencias monetarias existentes o que se implementen en el futuro; (iii) el reconocimiento de la Red de Oportunidades (RdO) como programa de transferencia monetaria del gobierno. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Manual Operativo del Programa de Atención Integral a la Infancia “Cuidarte” para áreas comarcales y rurales dispersas. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Manual operativo del programa 120 a los 65 que incluya los nuevos criterios de focalización y recertificación. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Manual operativo del programa Red de Oportunidades que incluya los nuevos criterios de focalización y recertificación. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Manual operativo del programa Ángel Guardián que incluya los nuevos criterios de focalización y recertificación. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Marco de políticas macroeconómicas adecuado PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Nota del MIDES que documente los avances en el rediseño de la estructura de la trasferencia monetaria de la Red de Oportunidades, que incluya al menos una de las siguientes variables: número de personas, ciclo educativo, nivel de pobreza. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Nota del MIDES que documente que se ha avanzado en la implementación gradual del mecanismo de pago por resultados y de financiamiento per cápita para los proveedores públicos y privados que administran los Centros de Orientación Infantil y Familiar (COIF), por medio de la licitación de la auditoría operativa y de la licitación de la entidad fiduciaria. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Nota del MIDES que documente que se ha avanzado en la implementación gradual del mecanismo de pago por resultados y de financiamiento per cápita para los proveedores públicos y privados que administran los Centros de Orientación Infantil y Familiar (COIF), por medio de la remisión a Contraloría del Reglamento Operativo del Modelo de Atención Integral a la Primera Infancia para los CAIPI (antes COIF). PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Nota del Ministerio de Desarrollo Social que documenta los avances en la racionalización de los procesos operativos del Bono Nutricional Alimenticio (BNA) y la Red de Oportunidades mediante la unificación de los padrones de beneficiarios de los dos programas. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Nota del Ministerio de Desarrollo Social que documenta que la Dirección de Inclusión y Desarrollo Social del MIDES está en funcionamiento, cumplimiento con su función de gerencia de los programas de protección social. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Nota del Ministerio de Desarrollo Social que documenta:
1. que se está utilizando la ficha única de protección social para evaluar la entrada y permanencia de los beneficiarios de los programas Red de Oportunidades, 120 a los 65 y Ángel Guardián;
2. el uso del nuevo mecanismo de identificación de la población en pobreza y pobreza extrema (nuevo proxy, con base en la nueva Ficha Única de Protección Social) para evaluar la solicitud de nuevos postulantes a los programas Red de Oportunidades, 120 a los 65 y Ángel Guardián;
3. la recertificación de 21.561 beneficiarios de la Red de Oportunidades y 120 a los 65 usando el nuevo mecanismo de focalización. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Oficio del MEF que evidencia la reducción por un monto de más de B./20 millones en el gasto de subsidios generalizados y el incremento por un monto de más de B./20 millones en el presupuesto del MIDES para los programas Red de Oportunidades, 120 a los 65 y Ángel Guardián. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Reglamento Operativo del Modelo de Atención Integral a la Primera Infancia para los CAIPI (antes COIF). PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Resolución Ministerial del MIDES que aprueba los Estándares de Calidad para los CAIPI (antes COIF). PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Resolución del Instituto para la Formación y Aprovechamiento de Recursos Humanos que aprueba el nuevo “Manual de Procedimientos de la Beca Universal” que incorpora los criterios de priorización establecidos por el MIDES. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama', 'Resolución del Ministerio de Desarrollo Social que:
1. aprueba el único puntaje para clasificar a los postulantes y beneficiarios de Red de Oportunidades, 120 a los 65 y Ángel Guardián como pobres o pobres extremos, de forma coherente con la definición de pobreza del Ministerio de Economía y Finanzas (MEF);
2. define los criterios de priorización para los programas de corte universal;
3. aprueba los los Manuales Operativos de los programas Red de Oportunidades, 120 a los 65 y Ángel Guardián que incluyen los criterios de focalización y recertificación. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIÓN SOCIAL II Panama']
